import "./../styles/Signup.scss";
import signUp from "./../assets/images/signupPhoto.jpg";

const Signup = () => {
  return (
    <div class="wrapper d-flex">
      <section class="form d-flex flex-column">
        <h1>SING UP</h1>
        <form action="" className="d-flex flex-">
          <input class="mt-5 mb-2" type="text" placeholder="Username" />
          <input class="mb-2" type="text" placeholder="Password" />
          <input class="mb-2" type="text" placeholder="Repeat passsword" />
          <input class="mb-5" type="text" placeholder="Email" />

          <div class="btn">{/* <input class="sub" type="submit""> */}</div>
        </form>
      </section>
      <section class="image">
        <img src={signUp} alt="" />
      </section>
    </div>
  );
};

export default Signup;
